function CourseCard({ course }) {
  return (
    <div className='w-full h-[240px] bg-white border border-secondary-tan rounded-2xl shadow-sm'>
      <div className='w-full h-2/3'>
        <img src={''} />
      </div>
      <div className='border-t border-secondary-tan px-2 py-2'>
        <p className='text-lg font-bold'>{course?.title}</p>
      </div>
    </div>
  );
}

export default CourseCard;
